        React.createElement("path", { d: "M2 10a8 8 0 1116 0 8 8 0 01-16 0zm4-3.5v2c0 .28.22.5.5.5H7v1.8l-1.35 1.35a.5.5 0 000 .7l1.5 1.5c.2.2.5.2.7 0L9.21 13H11v.5c0 .28.22.5.5.5h2a.5.5 0 00.5-.5v-2a.5.5 0 00-.5-.5h-2a.5.5 0 00-.5.5v.5H9.2L8 10.8V9h.5a.5.5 0 00.5-.5v-2a.5.5 0 00-.5-.5h-2a.5.5 0 00-.5.5z", fill: primaryFill }));
};
const FlowchartCircle20Filled = wrapIcon(rawSvg({}), 'FlowchartCircle20Filled');
export default FlowchartCircle20Filled;
